import restyleTheme, { TouchableBox } from '~/theme'

type Size = {
  height: string | number
  width: string | number
}

type IconProps = {
  name:
    | 'left-arrow'
    | 'notification'
    | 'menu'
    | 'print'
    | 'request'
    | 'calendar'
    | 'qrcode'
    | 'score'
    | 'account'
    | 'address'
    | 'download'
    | 'downArrow'
    | 'downBoldArrow'
    | 'upArrow'
    | 'plus'
    | 'pinFile'
    | 'sendMessage'
    | 'camera'
    | 'notebook'
    | 'settings'
    | 'evrika'
    | 'checkmark'
    | 'outlinePrevArrow'
    | 'outlineNextArrow'
    | 'times'
    | 'family'
    | 'edit'
    | 'moreDots'
    | 'createAdmin'
    | 'createManager'
    | 'delete'
    | 'chat'
    | 'time'
    | 'sort'
    | 'triangle'
    | 'filter'
    | 'skills'

  touchable?: boolean
  onPress?: () => void
  size?: Size
  color?: string
}

export const Icon: React.FC<IconProps> = ({
  name,
  size,
  touchable,
  onPress,
  color,
}) => {
  const _renderIcon = () => {
    switch (name) {
      case 'left-arrow':
        return <LeftArrow />
      case 'notification':
        return <Notification />
      case 'menu':
        return <MenuIcon />
      case 'print':
        return <PrintIcon />
      case 'request':
        return <RequestIcon />
      case 'calendar':
        return <CalendarIcon />
      case 'qrcode':
        return <QrcodeIcon />
      case 'score':
        return <ScoreIcon />
      case 'account':
        return <AccountIcon />
      case 'address':
        return <AddressIcon />
      case 'download':
        return <DownloadIcon />
      case 'downArrow':
        return <DownArrowIcon />
      case 'downBoldArrow':
        return <DownBoldArrowIcon />
      case 'upArrow':
        return <UpArrowIcon />
      case 'plus':
        return <PlusIcon {...{ size, color }} />
      case 'checkmark':
        return <CheckmarkIcon {...{ size }} />
      case 'pinFile':
        return <PinFileIcon />
      case 'sendMessage':
        return <SendMessageIcon />
      case 'camera':
        return <CameraIcon />
      case 'notebook':
        return <NotebookIcon />
      case 'settings':
        return <SettingsIcon />
      case 'evrika':
        return <EvrikaIcon />
      case 'outlinePrevArrow':
        return <OutlinePrevArrowIcon />
      case 'outlineNextArrow':
        return <OutlineNextArrowIcon />
      case 'times':
        return <TimesIcon />
      case 'family':
        return <FamilyIcon />
      case 'edit':
        return <EditIcon />
      case 'moreDots':
        return <MoreDotsIcon />
      case 'createAdmin':
        return <CreateAdminIcon />
      case 'createManager':
        return <CreateManagerIcon />
      case 'delete':
        return <DeleteIcon />
      case 'chat':
        return <ChatIcon />
      case 'time':
        return <TimeIcon />
      case 'sort':
        return <SortIcon />
      case 'triangle':
        return <TriangleIcon />
      case 'filter':
        return <FilterIcon />
      case 'skills':
        return <SkillsIcon />

      default:
        return null
    }
  }
  return touchable ? (
    <TouchableBox {...{ onPress }}>{_renderIcon()}</TouchableBox>
  ) : (
    _renderIcon()
  )
}

const IconWrap = ({ children }: { children: React.ReactNode }) => (
  <View
    style={[
      StyleSheet.absoluteFill,
      { alignItems: 'center', justifyContent: 'center' },
    ]}>
    {children}
  </View>
)

